import React from 'react'
import {UilCelsius, UilTimes } from '@iconscout/react-unicons'

function DropDownContent() {
  return (
    <div className='bg-blue-200 text-white fixed top-0 left-0 right-0 bottom-0 z-50 w-full h-full'>
        <header>
            <UilTimes size={20}/>
            <h4>Locations</h4>

        </header>
    </div>
  )
}

export default DropDownContent
